import {actions}  from '../Types/actionTypes';
import {Post} from '../Types/States';

//TODO??
//type returneAct =  (id?:number|undefined, data?:Post):PostActionTypes. => {}


export const getALlPosts = () => ({
        type: actions.GETALLPOSTS
});

export const getOnePosts = (id:number) => ({
    type: actions.GETONEPOST,
    id
});

export const getComments = (id:number) => ({
    type: actions.GETCOMMENTS,
    id
});

export const PostData = (data:Post) => ({
    type: actions.POST,
    data
});

export const DeletPost = (id:number) => ({
    type: actions.DELETE,
    id
});
